    <hr size=1>
    All dates shown are in Pacific Standard Time (GMT -8).
    <br><br>
    Views: the number of times a reader has accessed/viewed a page.
    <br>
    Visitors: the number of unique views, views from unique IP addresses (internet users), over a 24 hour period.
    <hr size=1>
    For example, a reader named Jane accessing/reading 5 chapters of a story equals to 5 views and 1 visitor.
    If Jane refreshes a chapter page 100 times, the system will record 100 views, but only 1 visitor. If Jane came back the next day, more than 24 hours later, and perform the same task, the system would record
    1 additional visitor. In summary, the visitor stat is the most important and accurate measure of reader traffic. Views can be duplicates from the same reader.
    <hr size=1>
    Stats are recorded/displayed at 3 levels: all stories (cumulative), story, and chapter. For each level, stats are are broken down into
